import React from "react";
import { ScrollView, StatusBar } from "react-native";

import Column from "../../components/Column";
import Background from '../../components/Background';
import WelcomeLogo from '../../components/WelcomeLogo';
import Text from "../../components/Text";
import ActionButton from "../../components/ActionButton";
import { SafeAreaView } from 'react-native';
//import { QuizIndex } from ".";
//import {Quiz} from './Quiz';

const QuizIndexScreen = ({ navigation }) => {
  return (
<Column as={SafeAreaView} flex={1} bg="white">
  <Column flex={1} mt={20}>
    <WelcomeLogo />
  </Column>

  <Column flex={1}>
    <Text color="#fff" fontWeight="bold" fontSize={22}>
    </Text>
    <Text color="#fff" fontWeight="bold" fontSize={18}>
    </Text>
    <ActionButton mt={20} onPress={() => navigation.navigate('QuizApp')} bg="white">
      <Text>LET'S START</Text>
    </ActionButton>
  </Column>
</Column>
  )

};

export default QuizIndexScreen;
